import React, { Component } from 'react'
import './App.css';
import Header from './components/layout/Header';
export class App extends Component {
  render() {
    return (
      <div className="App">



        <Header/>
          <section className="container">
            <h1 className="welcome"> </h1>
            <form id="search-form">
              <div id="google-logo"></div>
              <img id="google-logo" src="https://www.google.com/images/branding/googlelogo/2x/googlelogo_color_272x92dp.png" alt="googlelogo"/>
              <input id="search-bar" type="text"/>
              <input className="search-button button" type="submit" value="Google Search" onClick="onSubmit(event);"/>
            </form>
            <h2 className="message"> </h2>
          </section>




      </div>
    )
  }
}

export default App
